export default function Tile({ revealTile, square }) {

  const handleClick = (e) => {
    e.preventDefault()
    revealTile(square)
  }

  return (<div 
    className={square.classes} 
    id={square.id}
    onClick={handleClick} 
    onContextMenu={handleClick}/> 
  )
}
